import Link from "next/link";

const index = () => {
  console.log("Running INDEX component!!!");
  return (
    <div>
      <h1>Hello This is the Index Page</h1>
      <Link href="/about">AboutPage</Link>
      <Link href="/contact">ContactPage</Link>
    </div>
  );
};

export default index;
